using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace hackerRank
{
    class MorganString
    {
        public void Execute()
        {
            //string a = "JACK";
            //string b = "DANIEL";
            //string resExp = "DAJACKNIEL";

            //string a = "ABACABA";
            //string b = "ABACABA";
            //string resExp = "AABABACABACABA";

            //string a = "";
            //string b = "";
            //string resExp = "";

            string a = "";
            string b = "";
            string resExp = "";

            var watch = new System.Diagnostics.Stopwatch();
            watch.Start();

            string result = morganAndString(a, b);

            watch.Stop();

            if (resExp != result)
            {
                Console.WriteLine("Errore - Expected: " + resExp + " - now: " + result);
                Console.WriteLine("Errore!!!");
            }
            else
            {
                Console.WriteLine(result);
                Console.WriteLine("Perfetto!!!");
            }

            Console.WriteLine($"Execution Time: {watch.ElapsedMilliseconds} ms");
        }

        static string morganAndString(string a, string b)
        {
            StringBuilder res = new StringBuilder("");

            a += ".";
            b += ".";
            int indA = 0;
            int indB = 0;

            while (a[indA] != '.' && b[indB] != '.')
            {
                if (a[indA] != '.' && String.Compare(a.Substring(indA), b.Substring(indB)) < 0)
                {
                    res.Append(a[indA]);
                    indA += 1;
                }
                else
                {
                    res.Append(b[indB]);
                    indB += 1;
                }
            }

            if (a[indA] == '.')
            {
                a = a.Replace(".", "");
            }
            if (b[indB] == '.')
            {
                b = b.Replace(".", "");
            }

            if (indA < a.Length)
            {
                res.Append(a.Substring(indA));
            }
            else
            {
                if (indB < b.Length)
                {
                    res.Append(b.Substring(indB));
                }
            }

            return res.ToString();
        }


    }
}
